import React from "react";

function SetPlus (props) {
  let setplus
  let setminus
  let buttonStatus=<div className="page__status__link"><a onClick={props.onClick}>Сменить статус</a></div>
  if (props.button===true) {setplus=buttonStatus+<div className="page__status__input"><input className="page__status__input--redact" onChange={props.onChange} value={props.status} type="text" name="redaction"/></div>}
  else {setminus=<div className="page__status__text">{props.status}</div>}
  console.log(props)
  return (
    <div className="page__status">
      <div className="page__status__header">
        Здравствуйте, Человек №58745874
      </div>
      <div className="page__status__link">
        <a onClick={props.onClick}>Сменить статус</a>
      </div>
        {setplus}
        {setminus}
    </div>
  )
}

export default SetPlus
